                    </div>

                    <div>
                        <span> <ion-icon name="help"> </ion-icon> </span>
                        <h4> Enquiries</h4>
                        <p> Any Queries contact us</p> 

                    </div>
                </div>

            </div>
        );
    }

}

class icons extends Component {
    render() {
        return(
            <div>
                <span> </span>
                <h4> </h4>
                <p> </p>
            </div>
        )
    }
}

export default Services;
